import React, { Component } from 'react';
import { Row, Col, Container, Form, Image, Button } from 'react-bootstrap';

// import { Row, Col, Container, Form, Image, Button } from 'react-bootstrap';
// import imgLogoSezonaPocetna from './imgPretragaPocetna/sezona-logo.png';

import './FooterPocetna.css';

export default class FooterPocetna extends Component {
	render() {
		return (
			<React.Fragment>
				<Container fluid>
					<Row>
						<footer className="footer-pocetna">
                            <Col className="drzavafooter--pocetna">
								<h5 className="drzava-naslov-footer-pocetna">Bosna i Hercegovina</h5>
							</Col>
							<Col className="footer-linkovi-pocetna">
								<h1>Footer</h1>
							</Col>
						</footer>
					</Row>
				</Container>
			</React.Fragment>
		);
	}
}
